	static void solve() {
		int n = ni() + 1;
		int b = n / 200;
		b = Math.min(b, buffer.length - 1);

		BigInteger big = new BigInteger(buffer[b], 16);
		for (int i = b * 200 + 1; i <= n; i++) {
			big = big.multiply(BigInteger.valueOf(4 * i - 2));
			big = big.divide(BigInteger.valueOf(i + 1));
		}
		System.out.println(big.toString());
	}

